import React, { useState, useEffect } from 'react';
import axios from 'axios';

const TrainedModel = () => {
  const [models, setModels] = useState([]);

  // Fetch model data from the backend
  useEffect(() => {
    axios.get('http://127.0.0.1:5000/api/models') // replace with your actual API endpoint
      .then(response => {
        setModels(response.data);
      })
      .catch(error => {
        console.error('Error fetching models:', error);
      });
  }, []);

  const handleViewDetails = (modelId) => {
    // Handle view details logic
    console.log('View details for model', modelId);
  };

  const handleEdit = (modelId) => {
    // Handle edit logic
    console.log('Edit model', modelId);
  };

  const handleDeploy = (modelId) => {
    // Handle deploy logic
    console.log('Deploy model', modelId);
  };

  const handleDelete = (modelId) => {
    // Handle delete logic
    console.log('Delete model', modelId);
  };

  return (
    <div style={{ padding: '20px' }}>
      <h1>Trained Model</h1>
      {models.map((model) => (
        <div key={model.id} style={{
          border: '1px solid #ddd',
          borderRadius: '8px',
          padding: '20px',
          margin: '10px 0',
          position: 'relative'
        }}>
          <h3>{model.name}</h3>
          <p>Body text for whatever you‚Äôd like to say. Add main takeaway points, quotes, anecdotes, or even a very very short story.</p>

          <div style={{ display: 'flex', gap: '10px' }}>
            <button onClick={() => handleViewDetails(model.id)} style={{ display: 'flex', alignItems: 'center' }}>
              View Details <span role="img" aria-label="view">üëÅÔ∏è</span>
            </button>
            <button onClick={() => handleEdit(model.id)} style={{ display: 'flex', alignItems: 'center' }}>
              Edit <span role="img" aria-label="edit">‚úèÔ∏è</span>
            </button>

            <select style={{ flex: 1, padding: '5px' }}>
              <option value="">Select Task</option>
              <option value="task1">Task 1</option>
              <option value="task2">Task 2</option>
              <option value="task3">Task 3</option>
            </select>

            <button onClick={() => handleDeploy(model.id)} style={{ display: 'flex', alignItems: 'center' }}>
              Deploy <span role="img" aria-label="deploy">üîó</span>
            </button>
          </div>

          <button onClick={() => handleDelete(model.id)} style={{
            backgroundColor: '#e74c3c',
            color: '#fff',
            border: 'none',
            borderRadius: '4px',
            padding: '10px',
            position: 'absolute',
            top: '20px',
            right: '20px'
          }}>
            Delete <span role="img" aria-label="delete">üóëÔ∏è</span>
          </button>

          <div style={{ position: 'absolute', top: '20px', right: '100px', display: 'flex', alignItems: 'center' }}>
            <span>{model.status === 'active' ? 'Active' : 'Inactive'}</span>
            <span style={{
              width: '10px',
              height: '10px',
              borderRadius: '50%',
              backgroundColor: model.status === 'active' ? 'green' : 'grey',
              marginLeft: '5px'
            }}></span>
          </div>
        </div>
      ))}

      <button style={{
        padding: '10px',
        border: '1px solid #ddd',
        borderRadius: '8px',
        backgroundColor: '#f9f9f9',
        cursor: 'pointer',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        marginTop: '20px'
      }}>
        + Add Pulling Configuration
      </button>
    </div>
  );
};

export default TrainedModel;
